import React from 'react';

import TubeDBLogo from '../images/logo4.png';

import { HomeOutlined, PlaySquareOutlined, VideoCameraAddOutlined } from '@ant-design/icons';
import { Menu } from "antd";

const items = [
    {
        label: (
            <a href="/" target="_blank" rel="noopener noreferrer">
              Home
            </a>
          ),
        key: 'home',
        icon: <HomeOutlined />,
    },
    {
        label: (
            <a href="/" target="_blank" rel="noopener noreferrer">
              Trending Videos
            </a>
          ),
        key: 'trendingvideos',
        icon: <PlaySquareOutlined />,
    },
    {
        label: (
            <a href="/" target="_blank" rel="noopener noreferrer">
              Channels
            </a>
          ),
        key: 'channels',
        icon: <VideoCameraAddOutlined />,
    },
  ];

  class MyMenu extends React.Component {
    state = {
      selected: ['home']
    }

    render() {
      return (
        <Menu selectedKeys={this.state.selected}>
          <Menu.Item key="home">Home</Menu.Item>
        </Menu>
      )
    }
  }


  class HeaderMenu extends React.Component {
    constructor(props) {
      super(props)
      this.state = {
        current: 'home'
      }
      this.onClick = this.onClick.bind(this);
    } 
    onClick(e) {
      this.setState({current: this.state.key})
    }

    render(){
        return (
          <div>
            <Menu onClick={this.onClick} selectedKeys={this.current} mode="horizontal" items={items} />;
          </div>
        )
      }
  }

  export default MyMenu;
